import { library } from '@fortawesome/fontawesome-svg-core';

import {
  faCheck,
  faInfoCircle,
  faAngleDoubleUp,
  faExternalLinkAlt,
  faExclamationCircle,
} from '@fortawesome/free-solid-svg-icons';

import {
  faReact,
  faGithub,
  faMediumM,
  faTwitter,
} from '@fortawesome/free-brands-svg-icons';

library.add(
  faCheck,
  faReact,
  faGithub,
  faMediumM,
  faTwitter,
  faInfoCircle,
  faAngleDoubleUp,
  faExternalLinkAlt,
  faExclamationCircle,
);
